style.css:
@-moz-document url-prefix("https://neontra.com/") {
.AnalysisDetailsTableCell.topLevelClass {
    background: #dfdfda !important;
  }
  .AnalysisDetailsTableCell.parent, .AnalysisDetailsTableCell.item-cell, .onboardingBanner, .theme--neontra .widget-banner, .theme--neontra-alt .widget-banner, .Budgets .TopSummaryTile .TitleContainer, .TopSummaryTile {
  	background: #fff;
  }
  .left-cap .open {
    border-left: 10px solid #e1b7c1;
		margin-left: 10px;
    border-radius: 0;
  }
  .AnalysisDetailsTableCell.item-cell.right-cap {
    border: none !important;
    padding-right: 10px;
	}
  button.neontra-button.secondary {
    background: #ffcd2c !important;
  }
  .SiteControls {
    position: fixed;
    bottom: 0;
    left: 0;
    top: auto;
    width: 100px;
    height: 50px;
    background: #fff;
    border: 1px solid #cdcdcd;
    color: #2d2d2d;
  }
  .material-icons.false {
    margin-left: 20px;
  }
  .AnalysisDetailsTableCell[style="border-bottom: none; padding-left: 1.4rem;"] span.collapseHandler.fileSystemStyle.material-icons.false {
    margin-left: 35px;
  }
  .AnalysisDetailsTableGrid.budgetGrid .AnalysisDetailsTableCell {
    border-bottom: 1px solid #cdcdcd !important;
    border-radius: 0;
  }
  .AnalysisDetailsTableGrid.budgetGrid {
    grid-template-columns: 300px 70px auto 140px 140px 100px;
  }
  .TargetCell {
    background: none !important;
  }
  .tabs-container>.selected-backdrop {
    background: #d0a7af;
  }
  .widget-banner > .tabs-container {
    background: none;
    height: auto;
    font-weight: 600;
  }
  .widget-banner > .tabs-container .tab {
    height: auto;
    border: 1px solid #cdcdcd;
    padding: 10px;
    border-top-left-radius: 10px;
    border-top-right-radius: 10px;
    border-bottom: none;
  }
  .widget-banner > .tabs-container .tab.active {
    background-color: #edc6d7;
  }
  .tabs-container>.selected-backdrop {
    background: none;
  }
  .TopDateControlPrimary>*, .DropdownWrapper {
    background: #cdcdcd;
  }
  .side-nav {
    left: 0;
    top: 0;
    border-radius: 0px;
    border-bottom-right-radius: 7px;
    background: #fff !important;
    border: 1px solid #cdcdcd;
  }
  .widget-banner {
    border-bottom: 3px solid #cdcdcd;
    padding-bottom: 0px;
    margin-bottom: 5px;
  }
  .NeontraLogo {
    color: #292426 !important;
  }
  .side-nav .nav-icon {
    color: #2d2d2d !important;
  }
  .side-nav .nav-item.active .nav-icon {
    background: #eec3d7;
  }
  .side-nav .nav-item:hover .nav-icon {
    background: #2d2d2d;
    color: #eee !important;
  }
  .side-nav .nav-item:after {
    background: none !important;
  }
  .top-button :hover {
    color: #d87eb3;
  }
  .top-button.active {
    color: #7d7d7d;
  }
  .widget-banner > .tabs-container {
    background: none;
    height: auto;
    font-weight: 600;
    width: 80%;
  }
}
